function syncCheckboxesDeactivation(obj) {
  let scrollingElement = document.getElementsByClassName("sub-navigation-container");
  if (scrollingElement[0].classList.contains("menu-open") === false) {
    scrollingElement[0].classList.add("menu-open");
  }
  if (obj.id === "close-submenu") {
    scrollingElement[0].classList.remove("menu-open");
  }
  if (obj.checked === false ) {
    obj.checked = false;
    return;
  }
  let checkboxes = document.getElementsByClassName("flyout-menu");
  for (let i = 0; i < checkboxes.length; i++) {
    checkboxes[i].checked = false;
  }
  obj.checked = true;
}
